'use client';
import { globalStore, tabListStore } from '@/store';
import { usePathname, useRouter } from 'next//navigation';
import { ReactNode, useEffect, useState } from 'react';

const Navigation = ({ children }: { children: ReactNode }) => {
  return (
    <div className="flex">
      <SideBar />
      <div className="flex flex-col flex-1 overflow-hidden">
        <TabBar />
        <div className="flex-1 overflow-hidden">{children}</div>
      </div>
    </div>
  );
};

const TabBar = () => {
  const pathname = usePathname();
  const { tabList, addTab, deleteTab } = tabListStore();
  const router = useRouter();

  const moveTab = (url: string) => {
    router.push(url);
  };

  const removeTab = (url: string) => {
    const index = tabList.indexOf(url);
    const _tabList = [...tabList];

    if (_tabList.length === 1) {
      router.push('/home');
      addTab('/home');
    } else {
      if (pathname === url) {
        if (index === _tabList.length - 1) {
          router.push(_tabList[index - 1]);
        } else {
          router.push(_tabList[index + 1]);
        }
      }
    }

    deleteTab(url);
  };

  const leftTab = () => {
    const index = tabList.indexOf(pathname);
    if (index === 0) {
      router.push(tabList[tabList.length - 1]);
    } else {
      router.push(tabList[index - 1]);
    }
  };

  const rightTab = () => {
    const index = tabList.indexOf(pathname);
    if (index === tabList.length - 1) {
      router.push(tabList[0]);
    } else {
      router.push(tabList[index + 1]);
    }
  };
  const newTab = () => {};

  useEffect(() => {
    addTab(pathname);
  }, []);

  return (
    <div className="h-[36px] flex items-center bg-Gray0">
      <div className="flex justify-center items-center size-28 cursor-pointer" onClick={leftTab}>
        <svg width="18" height="18" viewBox="0 0 18 18" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path d="M10.5 11.5L7.5 8.5L10.5 5.5" stroke="#707C87" strokeLinecap="round" />
        </svg>
      </div>
      <div className="flex justify-center items-center size-28 cursor-pointer" onClick={rightTab}>
        <svg width="18" height="18" viewBox="0 0 18 18" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path d="M7.5 5.5L10.5 8.5L7.5 11.5" stroke="#707C87" strokeLinecap="round" />
        </svg>
      </div>
      <div className="flex justify-center items-center size-28 cursor-pointer" onClick={newTab}>
        <svg width="18" height="18" viewBox="0 0 18 18" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path d="M9 5.5V12.5M12.5 9H5.5" stroke="#707C87" strokeLinecap="round" strokeLinejoin="round" />
        </svg>
      </div>
      <div className="flex-1 flex h-full overflow-x-hidden">
        {tabList.map((e: string) => (
          <Tab key={e} url={e} handleClick={() => moveTab(e)} handleDelete={() => removeTab(e)} />
        ))}
      </div>
    </div>
  );
};

const Tab = ({ url, handleClick, handleDelete }: { url: string; handleClick(): void; handleDelete(): void }) => {
  const pathname = usePathname();

  return (
    <div
      className={`flex-[0_0_auto] select-none h-full flex items-center gap-12 border-r border-Gray2 px-12 cursor-pointer bg-${url === pathname ? 'White' : ''}`}
      onClick={handleClick}
    >
      <div className="text-14 font-400 whitespace-nowrap">
        {SideBarItemObject[url.split('/')[1]].subItemObject[url.split('/')[2]]
          ? SideBarItemObject[url.split('/')[1]].subItemObject[url.split('/')[2]].title
          : SideBarItemObject[url.split('/')[1]].title}
      </div>
      <div
        className="flex justify-center items-center size-20 cursor-pointer"
        onClick={(e) => {
          e.stopPropagation();
          handleDelete();
        }}
      >
        <svg width="16" height="16" viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path
            d="M11.5 11.5L4.5 4.5M11.5 4.5L4.5 11.5"
            stroke="#ADB5BD"
            strokeLinecap="round"
            strokeLinejoin="round"
          />
        </svg>
      </div>
    </div>
  );
};

const SideBar = () => {
  const router = useRouter();
  const { addTab } = tabListStore();
  const { minimize, toggleMinimize } = globalStore();

  const moveTab = (url: string) => {
    addTab(url);
    router.push(url);
  };

  return (
    <div
      className={`flex flex-col items-center ${minimize ? 'w-[72px]' : 'w-[240px]'} h-screen bg-Gray0 border-r border-Gray2`}
    >
      <div className={`flex ${minimize ? 'self-center' : 'self-end'} mb-8`}>
        <div className="flex justify-center items-center size-36 cursor-pointer" onClick={() => toggleMinimize()}>
          {minimize ? <Hamburger /> : <DoubleLeft />}
        </div>
      </div>
      <div className={`${minimize ? 'w-[40px]' : 'w-[200px]'} flex flex-col flex-1`}>
        <div className="flex items-center gap-12 mb-12">
          <div className="bg-Gray1 size-40 rounded-10"></div>
          {!minimize && <div className="text-16 font-700">브랜드 명</div>}
        </div>
        <div className="flex-1">
          {Object.entries(SideBarItemObject)
            .filter((_, i) => i === 0)
            .map(([key, value]) => (
              <SideBarItem key={key} {...value} url={key} handleClick={(url: string) => moveTab(url)} />
            ))}
          <div className="h-[1px] bg-Gray3 mb-12"></div>

          <div className="flex flex-col gap-4">
            {Object.entries(SideBarItemObject)
              .filter((_, i) => i !== 0)
              .map(([key, value]) => (
                <SideBarItem key={key} {...value} url={key} handleClick={(url: string) => moveTab(url)} />
              ))}
          </div>
        </div>

        <div className="flex items-center gap-12 mb-32">
          <div className="bg-Gray1 size-40 rounded-10"></div>
          {!minimize && (
            <div>
              <div className="text-16 font-700">OOO 님</div>
              <div className="text-12 font-400 text-Gray6">담당자 직책</div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

const SideBarItem = ({
  defaultSvg,
  activeSvg,
  title,
  url,
  subItemObject,
  handleClick,
}: {
  defaultSvg: ReactNode;
  activeSvg: ReactNode;
  url: string;
  title: string;
  subItemObject: { [key: string]: { title: string } };
  handleClick(url: string): void;
}) => {
  const { minimize } = globalStore();
  const pathname = usePathname();
  const [expansion, setExpansion] = useState(false);

  const moveToUrl = (subUrl: string) => {
    if (subUrl === '') {
      if (Object.entries(subItemObject).length === 0) {
        handleClick('/' + url);
      } else {
        setExpansion(!expansion);
      }
    } else {
      handleClick('/' + url + '/' + subUrl);
    }
  };

  return (
    <div className={`${expansion ? 'bg-White' : ''} rounded-8 select-none`}>
      <div className={`flex gap-12 rounded-8 py-8 px-12 cursor-pointer hover:bg-Blue0`} onClick={() => moveToUrl('')}>
        <div>{pathname.split('/')[1] === url ? activeSvg : defaultSvg}</div>
        {!minimize && (
          <div className={`text-12 ${pathname.split('/')[1] === url ? 'text-Blue6' : 'text-Black'} font-400`}>
            {title}
          </div>
        )}
      </div>
      {expansion && !minimize && (
        <div className="flex flex-col items-center">
          {Object.entries(subItemObject).map(([key, value]) => (
            <div
              key={key}
              className={`w-[176px] py-6 px-12 text-12 font-400 rounded-8 cursor-pointer hover:bg-Blue0 ${pathname.split('/')[2] === key ? 'bg-Blue0 text-Blue6' : ''}`}
              onClick={() => moveToUrl(key)}
            >
              {value.title}
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

